export type MessageType = {
  id: string;
  from: string;
  to: string;
  text: string;
  createdAt: string;
}

export const messages: MessageType[] = [
  {id: "1", from: "abc", to: "def", text: "Hello!", createdAt: '1:14 PM'}
];
